import React from 'react';
import menuList from '../utils/menuList';

function Navbar() {
  const menu = menuList.map((item) => (

    <ul className="menu">
      <li key={item.index} className="menu-list">
        { item.title }
      </li>
    </ul>
  ));
  return (
    <div className="navbar">
      <h2>Menu</h2>
      { menu }
    </div>
  );
}

export default Navbar;
